import React from "react";
import Navbar from "./Navbar";

function About() {
  return (
    <div className="About">
      <Navbar />
      <div className="About-text">
        <h1> About us </h1>{" "}
        <p>
          {" "}
          Gone are the days when people used to deal property matters on the
          basis of "mouth to mouth publicity" or nearby dealers.Globalization
          and fast lifestyle has encouraged the real estate industry to step in
          E - World.Now active partakers of real estate world are eagerly
          seeking the right options to establish themselves in E - Real Estate
          World.Realestate is a solution to all what bothers to people who all
          are dealing in properties or people who all are searching property.As
          one of the leading property portals, Realestate has tuned itself with
          pulse of real estate sector.Moving ahead with esteemed registered
          users and regularly visited by players of real estate industry,
          Realestate has become the pivot for real - estate sector{" "}
        </p>{" "}
        <h2> Know us </h2>{" "}
        <p>
          {" "}
          We are serving this industry by providing an online platform acting as
          a search engine or advertising agency.With our vast experience in the
          same field, we have emerged as the solitary solution provider.With
          such an immense exposure in the said domain, we completely understand
          the needs of our consumers and strive hard to meet the same. Being
          substantial in the realm of Real estate, we have stridden a long way
          in a short span of time.With our resolution to raise high, we beat the
          all hurdles and stood against all odds.This marvelous achievement has
          been the upshot of the trust, which our clients have shown over the
          years. RealestateIndia is owned and managed by Weblink.In Pvt.Ltd, a
          leading brand in web designing services and e - commerce
          solutions.Weblink.In Pvt.Ltd.is counted for its expertise in web
          solutions and its top ranking business portals.Our invincible
          expertise and rich experience has raised our spirit to reach ahead
          from our client 's expectation. Commendable success rate of other
          portals managed by Weblink is a live paradigm of our work excellence.
        </p>{" "}
        <h1> Mission </h1>{" "}
        <p>
          {" "}
          Our mission is to touch the horizon where our capabilities may
          successfully meet with the requirements of our clients, that too with
          ultimate transparency and cost - effectiveness{" "}
        </p>{" "}
      </div>
    </div>
  );
}

export default About;
